var constructDistrib = function (data) {
  var res = [];
  var currentCount = 0;
  var distribArea = 0;
  for (var i = 0; i < data.length; i++) {
    currentCount = currentCount + data[i].count;
    distribArea = distribArea + (currentCount / data.length)
    res.push({
      key: data[i].key,
      totalcount: currentCount,
      count: data[i].count
    });
  }
  return {
    entries: res,
    total: currentCount,
    bapex: (distribArea / currentCount)*100,
  };
};
